<!DOCTYPE html>
<html>
  <head>


    <style>
      body {
        background-color: #333;
        margin: 0;
        padding: 0;
        text-align: center;
		  height: 100%;
      }

      #game {
          margin: 0px auto;
          display: inline-block;
          position: absolute;
          top: 5.5%;
          left: 7%;
      }

	  #laptop {
          width: auto;
		  height: 99vh;
		  overflow: hidden;

	  }

	  @keyframes blink-red {
		  0% {fill: #cccccc;}
		  50% {fill: red;}
		  100% {fill: #cccccc;}
	  }
	  @keyframes act-green {
		  0% {fill: #cccccc;}
		  10% {fill: lime;}
		  15% {fill: #cccccc;}
		  20% {fill: lime;}
		  30% {fill: #cccccc;}
		  40% {fill: lime;}
		  44% {fill: #cccccc;}
		  70% {fill: lime;}
		  77% {fill: #cccccc;}
		  80% {fill: lime;}
		  84% {fill: #cccccc;}
		  100% {fill: lime;}
	  }

	  @keyframes act-yellow {
		  0% {fill: #cccccc;}
		  5% {fill: yellow;}
		  8% {fill: #cccccc;}
		  14% {fill: yellow;}
		  70% {fill: #cccccc;}
		  80% {fill: yellow;}
		  84% {fill: #cccccc;}
		  90% {fill: yellow;}
		  98% {fill: #cccccc;}
		  100% {fill: yellow;}
	  }

	  #led1 {
		  fill: MediumTurquoise;
	  }

	  #led2 {
		  fill: #cccccc;
		  animation-name: blink-red;
		  animation-duration: 1s;
		  animation-iteration-count: infinite;
		  animation-timing-function: steps(1);
	  }
	  #led3 {
		  fill: #cccccc;
		  animation-name: act-green;
		  animation-duration: 1s;
		  animation-iteration-count: infinite;
		  animation-direction: alternate;
	  }
	  #led4 {
		  fill: #cccccc;
		  animation-name: act-yellow;
		  animation-duration: 1s;
		  animation-iteration-count: infinite;
		  animation-direction: alternate;
		  animation-timing-function: steps(1);

	  }
    </style>
